import React from "react";
import {
    Container,
    Wrapper,

} from './LoginStyle'

import Head from '../../PartsLog/Head'
import Body from '../../PartsLog/Body'
import Foot from '../../PartsLog/Foot'

const login = () => {
    return (
        <Container>
            <Wrapper src="">
                <Head />
                <Body />
                <Foot />
            </Wrapper>
        </Container>
    );
};

export default login;
